.navbar {
  border-radius: 0px !important;
  height: 80px;
  position: fixed;
  z-index: 10;
  top: 0;
  left: 0;
  right: 0;
  .brand {
    width: 200px;
    text-align: center;
    font-size: 20px;
    color: #fff;
    line-height: 30px;
  }
  .hamburger-container {
    margin: 0 20px
  }
  .errLog-container {
    display: inline-block;
    vertical-align: top;
  }
  .right-menu {
    &:focus{
     outline: none;
    }
    .right-menu-item {
      display: inline-block;
      margin: 0 20px;
    }
    .international{
      vertical-align: top;
    }
    .avatar-container {
      .avatar-wrapper {
        cursor: pointer;
        position: relative;
        .user-avatar {
          width: 40px;
          height: 40px;
          border-radius: 10px;
        }
        .el-icon-caret-bottom {
          position: absolute;
          right: -20px;
          top: 0;
          bottom: 0;
          margin: auto;
          height: 15px;
          font-size: 12px;
        }
      }
    }
  }
}
